export const Filter = {
  species: {
    goofy: {
      title: '어종',
      items: [
        {
          id: 1,
          name: '고정 구피',
        },
        {
          id: 2,
          name: '팬시 구피',
        },
      ],
    },
  },
  filter: {
    title: '필터',
    items: [
      {
        id: 1,
        name: '가격순',
      },
      {
        id: 2,
        name: '인기순',
      },
      {
        id: 3,
        name: '최신순',
      },
    ],
  },
};
